import React from 'react';
import ReactFlow from 'react-flow-renderer';

const DataModelDiagram = () => {
    const elements = [
        { id: 'user', type: 'input', data: { label: 'User (UserID, Username, Email, Password, CreatedAt)' }, position: { x: 250, y: 0 } },
        { id: 'rating', data: { label: 'Rating (RatingID, UserID, Score, Comment, RatingDate)' }, position: { x: 100, y: 150 } },
        { id: 'e1-2', source: 'user', target: 'rating', animated: true, label: 'Foreign Key to User' }
    ];

    return (
        <div style={{ height: 300, width:300}}>
            <ReactFlow elements={elements} />
        </div>
    );
};

export default DataModelDiagram;
